	public static boolean isInferredSafe(int distance, int duration, int exhalation) {
	    Classifier classifier = UtilityFactory.getSingleton();

	    String[] featureNames = { "distance", "duration", "exhalationLevel" };
	    double[] inputValues = { distance, duration, exhalation };

	    String[] resultValues = { "true", "false" };
	    String predictedSafety = null;
	    try {
	        predictedSafety = WekaUtil.predictString(classifier, featureNames, inputValues, "safe", resultValues);
	    } catch (Exception e) {
	        e.printStackTrace();
	    }

	    return "safe".equals(predictedSafety);
	}


