    public static int compareSafetyComputations() {
        Random rand = new Random();
        int correctInferences = 0;

        System.out.println("Distance,Duration,Exhalation,Derived,Inferred");
        for (int i = 0; i < 10; i++) {
            int distance = rand.nextInt(33);
            int duration = rand.nextInt(144);
            int exhalation = rand.nextInt(60);

            boolean derivedSafety = isDerivedSafe(distance, duration, exhalation);
            boolean inferredSafety = isInferredSafe(distance, duration, exhalation);

            System.out.println(distance + "," + duration + "," + exhalation + "," + derivedSafety + "," + inferredSafety);
            
            if (derivedSafety == inferredSafety) {
                correctInferences++;
            }
        }
        return correctInferences;
    }

    public static boolean isDerivedSafe(int distance, int duration, int exhalation) {
        ModelInterface model = ModelFactory.getSingleton();
        model.setDistance(distance);
        model.setDuration(duration);
        model.setExhalationLevel(exhalation);
        return model.isSafe();
    }

}

