package controller;

import java.util.Scanner;

public class Controller {
	
	public void createFarm() {
		String[][] animals = new String[5][2];
	    Scanner scan = new Scanner(System.in);
	    int index = 0;
	    while(index < 5) {
	    	System.out.println("Welcome to the farm! What animals are you here to see? Enter up to 5 and -1 when finished");
	    	System.out.print("Enter animal species: ");
	    	String animal = scan.nextLine();
	    	System.out.print("What sound does this animal make: ");
	    	String sound = scan.nextLine();
	    	if (animal.equals("-1") || sound.equals("-1")) {
	    		break;
	    	}
	    	animals[index][0] = animal;
	    	animals[index][1] = sound;
	    	index++;
	    }
	    scan.close();
	    for (String[] elt : animals) {
	    	System.out.println(elt[0] + " makes the " + elt[1] + " sound.");
	    }
	    
	}
}

